import React from 'react';

function TemplateApp({description}) {
    if(description==null){
        description = "No description exists."
    } 
    return(
        <div id ="templateOverlay">
            <div id="templateContainer">
                <p>{description}</p>
            </div>
        </div>
    );
} export default TemplateApp;
